function Inicio (){
return (
  <div id="Page">
        <div id="titulo">
          <h1>Seja bem-vindo a Croct!</h1> 
        </div>
        <div id="introdution">
          <p>Dentre as opções abaixo, qual você mais se identifica?</p>
          <Link to="/developer">
             <button>Developer</button>
          </Link>
          <Link to="/marketer">
             <button>Marketer</button>
          </Link>
          <Link to="/hacker">
             <button>Growth-Hackers</button>
          </Link>
    </div>
   </div>
)}
})
export default StartTra;
